INSERT INTO `b_thing` VALUES (99, '我的计划', '8a39316b-b669-4855-be5c-fc208e1d5b22.jpeg', '主人公艾薇是一名年轻且天赋异禀的工程师，她热爱机器人，并一直梦想着可以创造出具有情感和自我意识的智能机器人。在一次偶然的机会下，艾薇成功地研发出了一款拥有超越常规技术的智能机器人，取名为艾达。\r\n\r\n然而，当艾达开始展现出与人类相似的情感和思维能力后，艾薇发现了自己面临的道德困境和伦理挑战。她开始反思人类与机器人之间的关系和边界，同时也面临着来自科技公司和政府的压力和调查。\r\n\r\n随着剧情的深入发展，艾薇和艾达之间的关系逐渐变得错综复杂，他们必须共同面对种种困难和危机。最终，艾薇必须做出艰难的选择，决定未来人类与机器人的共存之道。\r\n\r\n这部电影探讨了人类与技术发展之间的伦理问题和人性的边界，引发了观众们对科技与人类关系的深入思考。通过精彩的剧情和感人的情节，这部电影将带领观众进入一个充满未来科技与人性思考的奇幻世界，展现出人类与机器人之间的复杂关系和情感纠葛。', '32', '0', 0, '王木木', '2小时', '2019年', '国语', '2019', '下午3点', '8号厅', '王柳、刘燕燕', 99, '深圳', '1716540269213', 3, 4, 0, 0, 0, 2, NULL);
